import React from 'react'
import $ from 'jquery'
import 'jquery.gridstrap'
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
function Dr(props) {
    // {$('#basic-grid').gridstrap();}

    return (
        <>
        <DragDropContext>
            <Droppable droppableId="droppable-1" type="PERSON">
                {(provided, snapshot) => (
                    <div
                    ref={provided.innerRef}
                    style={{ backgroundColor: snapshot.isDraggingOver ? 'blue' : 'grey' }}
                    {...provided.droppableProps}
                    >
                    <div>
                    <Draggable key="key1" draggableId="draggable-key1" index={0}>
                        {(provided, snapshot) => {
                            <div id="grid" class="row">
                                <DragHandle />
                            <div class="col-xs-4 col-sm-2 col-md-1"><h1>Hello</h1></div>
                            <div class="col-xs-4 col-sm-2 col-md-1"><h1>world</h1></div>
                            </div>
                        }}
                        <Draggable />

                    </Draggable>
                    </div>
                    {provided.placeholder}
                    </div>
                )}
            </Droppable>;
        </DragDropContext>

        </>
    )
}
{/*  */}

export default Dr
